description:
In Champagne Showers, small town girl Violet played by Jessa Rhodes, moves to Los Angeles to pursue her dreams of becoming a singer. Fame doesn't come easy for her, as she faces rejection and sex at every direction. Struggling, Violet manages to land a job at Coyote Ugly, a bar occupied with hot and flirty female bartenders Nikita Von James, Kirsten Price, Layla Sin, and Breanne Benson. There she gains the confidence needed to perform at the talent show case and with the support of all her Coyotes. Throughout this emotional drama you will be treated to an array of sexual experiences, and lusty affairs. It's hot, it's steamy, and it's a visual triumph for your libido ... Extras. Info : Strange, as I remember Francois Clousot worked for Wicked ... A movie was quite merry, and always pleases me Dzheska.

